<template>
    <div class="animated fadeIn center">
        <div class="card-content">
            <div
                class="form-group col-md-12"
                style="display: flex; justify-content: center; align-items: center;"
            >
                <div
                    class="canvas-div"
                    style="position:absolute;"
                    ref="heatmap"
                >

                    <canvas
                        style="position:relative; opacity:1.0;"
                        ref="snapshot"
                        width="600"
                        height="400"
                    ></canvas>
                </div>

            </div>
        </div>

    </div>
</template>

<script lang="ts">
import { Vue, Component, Prop, Emit } from "vue-property-decorator";
import Heatmap from "heatmap.js";

@Component({})
export class CameraHeatmap extends Vue {
    //canvas
    private cx: CanvasRenderingContext2D;
    private canvasEl: HTMLCanvasElement;
    private image: HTMLImageElement;

    @Prop({
        type: Object,
        default: () => {
            return {
                name: "Name",
                snapshotBase64:
                    "data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7",
                cameraWidth: 600,
                cameraHeight: 400
            };
        }
    })
    snapshotData: Object;

    @Prop({
        type: Array,
        default: () => {
            return [];
        }
    })
    canvasData: [];

    private _canvasData = [];

    created() {}

    mounted() {
        this.initMap();
        this.initHeatmap();
    }

    initHeatmap() {
        // 創建一個heatmap實例對象
        let me = this;
        var heatmapInstance = Heatmap.create({
            container: me.$refs.heatmap as any
        });

        var points = [];
        var max = 0;
        var width = 600;
        var height = 400;
        var len = 200;
        while (len--) {
            var val = Math.floor(Math.random() * 10);
            max = Math.max(max, val);
            var point = {
                x: Math.floor(Math.random() * width),
                y: Math.floor(Math.random() * height),
                value: val
            };
            if (
                100 > point.x ||
                point.x > 500 ||
                100 > point.y ||
                point.y > 300
            ) {
                continue;
            }
            points.push(point);
        }
        var data = {
            max: max,
            data: points
        };

        heatmapInstance.setData(data);
        console.log("initHeatmap", heatmapInstance, data);
    }

    initMap() {
        let me = this;
        me.canvasEl = me.$refs.snapshot as any;
        me.cx = me.canvasEl.getContext("2d");

        me.cx.lineWidth = 3;
        me.image = new Image();
        me.image.src =
            "data:image/jpg;base64,";

        me.image.onload = () => {
            me.cx.drawImage(me.image, 0, 0, 600, 400);
        };
    }
}
export default CameraHeatmap;
Vue.component("camera-heatmap", CameraHeatmap);
</script>



<style lang="scss" scoped>
.canvas-div {
    width: 600;
    height: 400;
}

.center {
    margin: 0px auto;
}

.heatmap-canvas {
    opacity: 0.5;
}
</style>